import React from 'react'

const TableList=(props)=>{
    const ListWork=props.WorkList;
    const ShowList=ListWork.map((item,index)=>{
        return (
            <tr className={item.status===1?"table-success":"table-primary"}>
                <td>{index}</td>
                <td>{item.work}</td>
                <td>{item.status===1?"Quan trọng":"Không quan trọng"}</td>
                <td>
                    <button type="button" className="btn btn-warning  btn-sm">Sửa</button>
                    <button type="button" className="btn btn-danger  btn-sm setting">Xóa</button>
                </td>
            </tr> 
        )
    })
    return (
        <tbody>
            {ShowList}
        </tbody>
    )
}

export default TableList
